function init()
	ini()
	equipItem = false
	if player.uniqueId() == "Spinach Dip" and sheathEnabled then -- ensure player is inferion
		equipItem = true
	end
	message.setHandler("infernoSheathed",function(_,clientSender,sheathState)
		if clientSender and player.uniqueId() == "Spinach Dip" and sheathEnabled then
			if sheathState then
				player.setEquippedItem("backCosmetic",swordItem)
			else
				player.setEquippedItem("backCosmetic",sheathItem)
			end
		end
	end)
end

function update(...)
	upd(...)
	if equipItem and sheathEnabled then
		equipItem = false
		player.setEquippedItem("backCosmetic",swordItem)
	end
end

function uninit()
	unini()
end